 const {ProductName,ProductImage,ProductDescription,ProductPrice} = productObj.t
 
  return (
     <article className='product'> 
        {/* // key={ProductName} */}
        <img src= {ProductImage} alt={ProductName} />
        <h2> {ProductName} </h2>
        <p> {ProductDescription} </p>
        <p>${ProductPrice}</p>
        <button>Add to cart</button>
    </article>  )
}

